USE pad;

CREATE TABLE `pad`.`port_operator_independent_port_operator` (
    `id` INT NOT NULL AUTO_INCREMENT,
    `port_operator_id` INT NOT NULL,
    `independent_port_operator_id` INT NOT NULL,
    `date_created` DATETIME NOT NULL,
    PRIMARY KEY (`id`),
    INDEX `port_operator_id_ik` (`port_operator_id` ASC),
    INDEX `independent_port_operator_id_ik` (`independent_port_operator_id` ASC)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

